import React from 'react';

function Table() {
    return (
        <div>
            <h1>Page Table</h1>
            <table border="2">
                <tbody>
                    <tr>
                        <td>cell is row 0 column 0</td>
                        <td>cell is row 0 column 1</td>
                    </tr>
                    <tr>
                        <td>cell is row 1 column 0</td>
                        <td>cell is row 1 column 1</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default Table;
